/**
 * Stores the arrow tip to a StorableOutput.
 */
public void write(StorableOutput dw) {
    dw.writeDouble(getAngle());
    dw.writeDouble(getOuterRadius());
    dw.writeDouble(getInnerRadius());
    super.write(dw);
}
